import React from 'react';
import {css, StyleSheet} from 'aphrodite';
import Text from "../../../helpers/Text";

function Service(props) {
    const style = StyleSheet.create({
        outer: {
            borderRadius:"8px",
            justifyContent:"space-between",
            padding:"1.3rem",
            border:"1px solid #EAE9F2",
            width: "38%",
            height: "1rem",
            marginBottom:"0.8rem",
        },
        checkBox: {
            height:"20px",
            width:"20px",
            border: "1px solid #979797",
            borderRadius: "50%",
            marginRight:"14px"
        },
        innerFlex: {
            alignItems:"center"
        }
    })
    return (
        <div  className={css(style.outer, style.innerFlex) + " row"}>
            <div className={css(style.innerFlex) + " row"}>
                <div className={css(style.checkBox)}>
                </div>
                <Text text="Service number" > </Text>
            </div>
            <Text text="Price"/>
        </div>
    );
}

export default Service;
